import React  from "react";

function EmptySearch () {
    return(
        <div className="container mt-5">
            <div className="row">
                <div className="col-10 mx-auto text-center">
                    <h1> No results </h1>
                </div>
            </div>
        </div>
    );
}
export default EmptySearch;
